import axios from "axios";
export const fetchProducts = () => {
  return function (dispatch) {
    dispatch({
      type: "FETCH_PRODUCTS",
    });
    axios
      .get("https://ecommerce-31a69.firebaseio.com/products.json")
      .then((res) => res.data)
      .then((data) =>
        dispatch({
          type: "RECEIVE_PRODUCTS",
          products: data,
        })
      )
      .catch((error) => console.log(error));
  };
};
